import axios from "axios";
import "./userList.css";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import react, { useEffect, useState } from "react";
import { Button, ButtonBase, FormLabel, TextField } from "@material-ui/core";
import { Link } from "react-router-dom/cjs/react-router-dom.min";

export default function UserList() {
  const [users, setUsers] = useState([]);
  const [search, setSearch] = useState("");
  useEffect(() => {
    loadProduct();
  }, []);

  const loadProduct = async () => {
    await axios.get("http://localhost:3003/user").then((res) => {
      setUsers(res.data);
    });
  };
  const useStyles = makeStyles({
    action: {
      display: "flex",
      marginLeft: "25px",
      textAlign: "center",
    },

    tablecell: {
      textAlign: "left",
    },
    tablerow: {
      textAlign: "inherit",
    },
    btn: {
      backgroundColor: "rgb(228, 228, 250)",
      float: "center",
      margincenter: 50,
    },
  });
  const classes = useStyles();
  const DeleteProduct = async (id) => {
    await axios.delete(`http://localhost:3003/user/${id}`);
    loadProduct();
  };
  return (
    <div className="userList">
      <div className="App">
        <Link to="/newUser">
          {" "}
          <Button variant="outlined">Add user</Button>
        </Link>
        <input
          onChange={(e) => setSearch(e.target.value)}
          type="search"
          placeholder="serach.."
          className="search"
        />
        <br />
        <br />
        <br />
        <div className="flex">
          <form>
            <TableContainer component={Paper}>
              <Table  aria-label="simple table">
                <TableHead>
                  <TableRow >
                    <TableCell>Sl NO</TableCell>
                    <TableCell >UserName</TableCell>
                    <TableCell >Name</TableCell>
                    <TableCell >Phone</TableCell>
                    <TableCell >Address</TableCell>
                    <TableCell >Role</TableCell>
                    <TableCell >Email</TableCell>
                    <TableCell >Action</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {users &&
                    users
                      .filter((val) => {
                        if (search == "") {
                          return val;
                        } else if (
                          val.name.toLowerCase().includes(search.toLowerCase())
                        ) {
                          return val;
                        }
                      })
                      .map((datas, i) => {
                        return (
                          <TableRow key={i}>
                            <TableCell >
                              {i + 1}
                            </TableCell>
                            <TableCell >{datas.UserName}</TableCell>
                            <TableCell >{datas.FullName} </TableCell>
                            <TableCell >{datas.phone} </TableCell>
                            <TableCell >{datas.address} </TableCell>
                            <TableCell >{datas.role} </TableCell>
                            <TableCell >{datas.email} </TableCell>
                            <TableCell > </TableCell>
                          </TableRow>
                        );
                      })}
                </TableBody>
              </Table>
            </TableContainer>
          </form>
        </div>
      </div>
    </div>
  );
}
